css:
.nuclide-ui-message {
  border: 1px solid #151f28;
  border-radius: 3px;
  margin: 5px;
  padding: 10px;
  border-left-width: 5px;
  line-height: 2;
}
.nuclide-ui-message-default {
  border-color: rgba(153, 168, 184, 0.6);
}
.nuclide-ui-message-error {
  color: #ff6347;
  border-color: #ff6347;
}
.nuclide-ui-message-info {
  color: #6494ed;
  border-color: #6494ed;
}
.nuclide-ui-message-success {
  color: #73c990;
  border-color: #73c990;
}
.nuclide-ui-message-warning {
  color: #e2c08d;
  border-color: #e2c08d;
}
